tables.table_schema:
CREATE TABLE AI_Ethical_Guidelines (
	guideline_id INT PRIMARY KEY,
	guideline_name VARCHAR(255) NOT NULL,
	description TEXT
);

CREATE TABLE AI_Principles (
	principle_id INT PRIMARY KEY,
	principle_name VARCHAR(255) NOT NULL,
	details TEXT
);

CREATE TABLE ethical_guidelines (
	author_name VARCHAR(50),
	category VARCHAR(50),
	content TEXT,
	creation_date DATE
);

CREATE TABLE principles (
	principle_id SERIAL PRIMARY KEY,
	principle_name VARCHAR(100) NOT NULL,
	description TEXT
);

CREATE TABLE implementations (
	implementation_id SERIAL PRIMARY KEY,
	project_name VARCHAR(100) NOT NULL,
	implementation_details TEXT,
	status VARCHAR(20)
);
